import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Header from "./Header";
import HomeConts1 from "./HomeConts1";
import HomeConts2 from "./HomeConts2"; // Import HomeConts2
import HomeConts3 from "./HomeConts3"; // Import HomeConts3
import HomeConts4 from "./HomeConts4"; // Import HomeConts4

const App = () => {
  return (
    <Router>
      <Header />
      <Switch>
        <Route path="/" exact component={HomeConts1} />
        <Route path="/about" component={HomeConts2} /> {/* Use HomeConts2 */}
        <Route path="/projects" component={HomeConts3} /> {/* Use HomeConts3 */}
        <Route path="/contact" component={HomeConts4} /> {/* Use HomeConts4 */}
      </Switch>
    </Router>
  );
};

export default App;
